import { factory } from '@flashcards/client'

const loginWithProvider = factory.createLoginWithProvider()
const getTopics = factory.createGetTopics()
const getTopic = factory.createGetTopic()
const getTopicsObserver = factory.createGetTopicsObserver()
const addTopic = factory.createAddTopic()
const removeTopic = factory.createRemoveTopic()
const addCard = factory.createAddCard()

export { loginWithProvider, getTopics, getTopicsObserver, getTopic, addTopic, removeTopic, addCard }
